import{i as n}from"./entry.f6bc60b7.js";const a=n("main",{state:()=>({projectsHeading:"Projects Portfolio",projectsDescription:"Some of the projects I have successfully completed",projects:[{id:"260d1271-f1f2-4bc9-a5eb-05a89c8cccdb",title:"Shopify Projects",category:"Web Services",img:"https://ebisontj.github.io/images/shopify-projects.jpeg",publishDate:"Nov 04, 2021",tag:"Web Services",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:"I've excelled in various Shopify projects, from tailored checkouts to inventory management and multi-language support, using Node.js and PHP (Laravel). My expertise in Shopify's API and third-party integrations has consistently exceeded client expectations, driving my passion for continued contributions in Shopify development.",techTitle:"Tools & Technologies",detailsTitle:"Challenge",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"shopify-projects",img:"https://ebisontj.github.io/images/shopify-projects.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"shopify-projects",img:"https://ebisontj.github.io/images/shopify-projects2.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"shopify-projects",img:"https://ebisontj.github.io/images/shopify-projects4.jpeg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"EMSOFTECH PVT LTD"},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web applications"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://emsoftech.com"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:"+91-484-2413280"}],technologies:["Shopify","HTML","CSS","PHP","Laravel","JavaScript","VueJs","NodeJs","GraphQl","RUST"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:"<p>In my capacity as a developer, I have successfully executed a diverse range of Shopify projects, each tailored to meet the unique needs of my clients. These projects have allowed me to delve deep into the intricacies of Shopify's checkout extension and its multifaceted functionalities.</p><p>To enhance the functionality of Shopify stores, I've harnessed the power of backend scripts written in Node.js and PHP (specifically, Laravel). These scripts have proven invaluable in generating a variety of reports and effectively managing critical aspects of the online store. Some of the noteworthy projects I've had the privilege of delivering include:</p><ul><li><strong>Customized Checkout Flow:</strong> I've adeptly customized the checkout process to align with specific client requirements, ensuring a seamless and tailored shopping experience for customers.</li><li><strong>Product Recommendation System:</strong> Leveraging Shopify's capabilities, I've implemented a product recommendation system that enhances upselling and cross-selling opportunities, thereby increasing sales.</li><li><strong>Custom Inventory Management System:</strong> I've developed a bespoke inventory management system that optimizes inventory tracking and management, ensuring products are efficiently stocked and readily available.</li><li><strong>Sales and Analytics Reports:</strong> I've designed and implemented comprehensive reporting systems that provide clients with real-time insights into their store's performance, enabling data-driven decision-making.</li><li><strong>Custom Theme Design:</strong> I've crafted unique, eye-catching themes that not only reflect the brand identity but also enhance user engagement and overall aesthetics.</li><li><strong>Subscription-Based Services:</strong> I've enabled subscription-based services, allowing clients to implement subscription models, a popular and effective strategy for recurring revenue.</li><li><strong>Multi-Language Support:</strong> Recognizing the importance of a global audience, I've integrated multi-language support, making the shopping experience accessible and engaging for diverse customer bases.</li></ul><p>Throughout these projects, I've honed my expertise in utilizing Shopify's API, seamlessly integrating with third-party services to expand functionality, and implementing intricate business logic. My commitment to delivering top-notch solutions is evident in the successful implementation of these projects, which have not only met but often exceeded client expectations. I look forward to continuing my journey in the ever-evolving realm of Shopify development, applying my skills to create tailored, high-performing online stores.</p>"}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]},{id:"260d1271-f1f2-4bc9-a5eb-05a89c8cccdc",title:"Core Schedule",category:"Web Application",img:"https://ebisontj.github.io/images/coreschedule.jpeg",publishDate:"Nov 04, 2021",tag:"Web Application",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:"I led the creation of a Hospital Management System, automating staff payroll and optimizing scheduling with advanced algorithms. Using Yii1, HTML, CSS, and JavaScript, I ensured a user-friendly interface. Robust SQL databases stored data securely, while customizable reporting tools provided real-time insights, enhancing patient care and operational efficiency. This project showcases my expertise in complex web-based systems and fuels my passion for future web development endeavors",detailsTitle:"Challenge",socialTitle:"Share This",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"coreschedule",img:"https://ebisontj.github.io/images/coreschedule.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"coreschedule1",img:"https://ebisontj.github.io/images/coreschedule1.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"coreschedule2",img:"https://ebisontj.github.io/images/coreschedule2.jpeg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"EMSOFTECH PVT LTD"},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web applications"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://emsoftech.com"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:"+91-484-2413280"}],technologies:["PHP","Yii 1","MySQL","HTML","CSS","JavaScript"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:"<p>One of my standout projects in the field of web development is the creation of a robust Hospital Management System. This project involved designing and building a comprehensive system that revolutionized the way healthcare facilities manage their daily operations.</p><p>In this project, I was responsible for developing a range of functionalities that have significantly enhanced hospital management. I implemented a feature-rich staff payroll system, allowing for accurate and efficient payroll processing. This involved creating a user-friendly interface for staff to input their attendance and leave data, which the system would then process seamlessly.</p><p>Additionally, I designed a sophisticated scheduling module that optimizes staff allocation based on their availability and the hospital's needs. This module incorporates advanced algorithms to ensure that shifts are efficiently assigned, minimizing overtime and ensuring adequate coverage at all times.</p><p>On the technical side, I utilized a stack of technologies that included Yii1 for backend development, and for the frontend, I implemented responsive and intuitive user interfaces using HTML, CSS, and JavaScript. This approach ensured that the system was accessible and easy to use for all staff members, regardless of their technical background.</p><p>Database management was a critical aspect of this project. I created and maintained a robust relational database system using SQL, which securely stored patient records, staff information, and operational data. This database architecture was designed to scale efficiently as the hospital's data needs grew over time.</p><p>One of the standout features of the Hospital Management System is its reporting capabilities. I integrated powerful reporting tools to generate customized reports tailored to the specific needs of healthcare professionals. These reports provide real-time insights into key performance metrics, enabling hospital administrators to make data-driven decisions and improve patient care.</p><p>The success of this project was evident in the positive feedback it received from its users. Hospital staff commended the system for its user-friendly interface, reliability, and its ability to streamline their day-to-day tasks. Most importantly, the Hospital Management System has resulted in significant improvements in operational efficiency, error reduction, and ultimately, enhanced patient care.</p><p>This project serves as a prime example of my ability to conceive, plan, and execute complex web-based systems, and I am eager to apply the knowledge and experience gained from this project to future endeavors in web development.</p>"}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]},{id:"260d1271-f1f2-4bc9-a5eb-05a89c8cccdy",title:"StreamVPN",category:"Web Application",img:"https://ebisontj.github.io/images/streamvpn3.jpeg",publishDate:"Nov 04, 2021",tag:"Web Applications",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:`I played a pivotal role in developing the "StreamVPN" project, formerly known as "My Expat Network" a VPN Management Application using the Yii2 framework. This endeavor allowed me to master Yii2, HTML, and JavaScript for web application development while also gaining expertise in integrating third-party APIs for payment processing and email notifications. The project's success showcased my commitment to delivering user-centric solutions and deepened my passion for creating innovative web applications.`,techTitle:"Tools & Technologies",detailsTitle:"Challenge",socialTitle:"Share This",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"Project Management UI",img:"https://ebisontj.github.io/images/streamvpn3.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Project Management UI",img:"https://ebisontj.github.io/images/streamvpn.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Project Management UI",img:"https://ebisontj.github.io/images/streamvpn2.jpeg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"EMSOFTECH PVT LTD"},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web applications"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://emsoftech.com"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:"+91-484-2413280"}],technologies:["HTML","CSS","JavaScript","Yii 2"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:`<p>I had the privilege of working on the "StreamVPN" project, formerly known as "My Expat Network" a VPN Management Application developed using the Yii2 framework. This project presented an exciting opportunity to create a robust platform for the efficient management of VPN subscriptions and billing, incorporating essential features like email notifications to enhance user engagement and communication.</p><p>Throughout the development of StreamVPN, I delved deep into the Yii2 framework, mastering its capabilities for creating robust and scalable web applications. Utilizing Yii2, I not only ensured the application's stability but also enriched its user experience with seamless navigation and responsive design.</p><p>A significant aspect of this project involved integrating with third-party APIs for payment processing and email notifications. This experience broadened my skill set and exposed me to the intricacies of securely handling financial transactions and maintaining effective communication with users through automated email notifications.</p><p>In addition to Yii2, I leveraged modern web technologies such as HTML and JavaScript to enhance the application's frontend, ensuring an intuitive and user-friendly interface. This approach was pivotal in ensuring that users could effortlessly manage their VPN subscriptions and billing details.</p><p>The StreamVPN project was not just about developing a functional application; it was about providing users with a seamless and secure VPN experience. It demanded meticulous attention to detail, robust coding practices, and effective integration of various components. The successful execution of this project has enriched my expertise in web development, API integration, and user-focused design.</p><p>I take pride in my contribution to the StreamVPN project and the valuable experience it has provided. It serves as a testament to my commitment to excellence and my ability to navigate the complexities of modern web technologies to deliver practical and user-centric solutions. This experience has further fueled my passion for crafting innovative web applications that empower users and organizations alike.</p>`}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]},{id:"260d1271-f1f2-4bc9-a5eb-05a89c8ccc99",title:"Re-member App",category:"Web Application",img:"https://ebisontj.github.io/images/re-member2.jpeg",publishDate:"Nov 04, 2021",tag:"Web / Frontend",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:`I joined the "Re-member App" project later in its development to focus on updates and maintenance. This software simplifies member database management for organizations and has received positive feedback for its user-friendliness and reliability. My role involved ensuring the software's continued effectiveness, highlighting my commitment to enhancing practical solutions for real-world challenges.`,techTitle:"Tools & Technologies",detailsTitle:"Challenge",socialTitle:"Share This",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"Cloud Storage Platform",img:"https://ebisontj.github.io/images/re-member2.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Cloud Storage Platform",img:"https://ebisontj.github.io/images/re-member.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Cloud Storage Platform",img:"https://ebisontj.github.io/images/re-member1.jpeg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"EMSOFTECH PVT LTD"},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web applications"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://emsoftech.com"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:"+91-484-2413280"}],technologies:["HTML","CSS","JavaScript","Yii 2"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:`<p>I joined the "Re-member App" project later in its development lifecycle, primarily focusing on updates and maintenance. This versatile membership data management software simplifies member database management for various organizations, including social clubs, sports groups, religious organizations, and NGOs.</p><p>During my involvement, I specialized in maintaining and enhancing the software. This role allowed me to gain hands-on experience in ensuring the software's reliability and keeping it up-to-date with evolving requirements. Users have appreciated the software's user-friendly design, adaptability, and continued reliability.</p><p>My contributions to the "Re-member App" project underscore my ability to support and improve existing solutions, addressing evolving needs, and ensuring their ongoing effectiveness for organizations. This experience reflects my commitment to enhancing practical solutions for real-world challenges.</p>`}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]},{id:"260d1271-f1f2-4bc9-a5eb-05a89c8cccdm",title:"Riosis Projects",category:"Web Services",img:"https://ebisontj.github.io/images/riosis.jpeg",publishDate:"Nov 04, 2021",tag:"Web Services",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:"During my tenure as a Full Stack Developer at Riosis (Innovation Hub) Pvt. Ltd., I specialized in utilizing modern web technologies, particularly VueJS and NuxtJS for front-end development, and a proprietary PHP framework similar to Laravel for back-end development. My expertise includes designing RESTful APIs and efficient database communication using the Eloquent ORM. The projects I contributed to received positive feedback for their user-friendly interfaces, efficiency, and reliability, reflecting my commitment to delivering practical and innovative web solutions.",techTitle:"Tools & Technologies",detailsTitle:"Challenge",socialTitle:"Share This",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"Uber Social App",img:"https://ebisontj.github.io/images/riosis1.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Uber Social App",img:"https://ebisontj.github.io/images/riosis.jpeg"},{id:"12345-fgff-4589-ghhhf",title:"Uber Social App",img:"https://ebisontj.github.io/images/web-project-2.jpg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"Riosis (Innovation Hub) Pvt. Ltd."},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://www.riosis.com/"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:"+91 9995 626 167"}],technologies:["HTML","CSS","JavaScript","VueJs","ElasticSearch","MySQL","Nuxt.js"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:"<p>During my role as a Full Stack Developer at Riosis (Innovation Hub) Pvt. Ltd., I actively contributed to a diverse array of projects that harnessed state-of-the-art web technologies to drive innovation. My primary area of expertise lay in front-end development, where I extensively employed VueJS within the NuxtJS framework to craft dynamic and responsive user interfaces.</p><p>On the back-end, I had the privilege of working with the company's proprietary PHP framework, which closely resembles Laravel, particularly in its use of the Eloquent ORM for seamless database communication. This experience enabled me to master the intricacies of designing and implementing RESTful APIs, thus contributing to the development of scalable web applications with a strong emphasis on performance and efficiency.</p><p>The projects I've been a part of have garnered commendation from their users, thanks to their user-friendly interfaces, seamless functionality, and unwavering reliability. My role at Riosis (Innovation Hub) Pvt. Ltd. has significantly enriched my expertise in modern web technologies, API design, and efficient database communication. This experience underscores my unwavering commitment to delivering practical and user-centric solutions in the ever-evolving realm of web development.</p>"}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]},{id:"260d1271-f1f2-4bc9-a5eb-05a89c8cccbb",title:"Ridhitech Projects",category:"Web Services",img:"https://ebisontj.github.io/images/web-project-1.jpg",publishDate:"Nov 04, 2021",tag:"Web Services",clientTitle:"About Client",objectivesTitle:"Objective",objectivesDetails:"As a Full Stack Developer at Ridhitech India Pvt. Ltd., I played a key role in diverse projects, all built on the CodeIgniter framework with user-friendly interfaces created using AdminLTE templates. I developed scalable web applications, implemented RESTful APIs, and adhered to the MVC architecture for maintainable code. These projects were well-received for their efficiency and reliability, showcasing my commitment to delivering practical, modern web solutions.",techTitle:"Tools & Technologies",detailsTitle:"Challenge",socialTitle:"Share This",projectImages:[{id:"12345-fgff-4589-ghhhf",title:"Apple Design System",img:"https://ebisontj.github.io/images/web-project-1.jpg"},{id:"12345-fgff-4589-ghhhf",title:"Apple Design System",img:"https://ebisontj.github.io/images/web-project-2.jpg"},{id:"12345-fgff-4589-ghhhf",title:"Apple Design System",img:"https://ebisontj.github.io/images/Ridhitech3.jpeg"}],companyInfos:[{id:"12345-fgff-4589-ghhhf",title:"Name",details:"Ridhitech India Pvt. Ltd."},{id:"12345-fgff-4589-ghhhf",title:"Services",details:"Web"},{id:"12345-fgff-4589-ghhhf",title:"Website",details:"https://www.ridhitechindia.com/"},{id:"12345-fgff-4589-ghhhf",title:"Phone",details:" +91-9895-61-1155"}],technologies:["HTML","CSS","JavaScript","Codeigniter"],projectDetails:[{id:"12345-fgff-4589-ghhhf",details:"<p>During my role as a Full Stack Developer at Ridhitech India Pvt. Ltd., I made substantial contributions to a range of projects that harnessed modern web technologies. These projects were built on the robust CodeIgniter framework, with user interfaces crafted using templates like AdminLTE, ensuring a seamless and visually engaging user experience.</p><p>Through these projects, I gained expertise in developing highly scalable web applications, leveraging modern web technologies. My responsibilities included the design and implementation of RESTful APIs, facilitating smooth communication between various components. Embracing the Model-View-Controller (MVC) architecture, I ensured that the codebase was not only efficient but also highly maintainable, a crucial consideration in the dynamic web development landscape.</p><p>The impact of these projects was evident in their positive reception among users, who appreciated their user-friendly interfaces, operational efficiency, and unwavering reliability. My experience at Ridhitech India Pvt. Ltd. highlights my commitment to delivering practical, efficient, and user-centric solutions, all while staying at the forefront of modern web development technologies.</p>"}],socialSharings:[{id:"12345-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12345-fgff-4589-ghhhf",name:"LinkedIn",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12345-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33?mibextid=ZbWKwL"},{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"}]}],clientsHeading:"Some of the brands I worked with",clients:[{id:"12345-fgff-4589-ghhhf",title:"Amazon",img:"https://ebisontj.github.io/brands/amazon_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"Sony",img:"https://ebisontj.github.io/brands/sony_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"Adidas",img:"https://ebisontj.github.io/brands/adidas_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"FILA",img:"https://ebisontj.github.io/brands/fila_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"NB",img:"https://ebisontj.github.io/brands/nb_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"SAMSUNG",img:"https://ebisontj.github.io/brands/samsung_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"CANON",img:"https://ebisontj.github.io/brands/canon_gray.png"},{id:"12345-fgff-4589-ghhhf",title:"PUMA",img:"https://ebisontj.github.io/brands/puma_gray.png"}],aboutMe:[{id:"12345-fgff-4589-ghhhf",bio:"<p>I'm excited to introduce myself and provide you with a glimpse into my professional journey. My passion lies in the world of web development, where I've honed my skills over the course of 5 years. With a strong educational background in electronics as my foundation, I've ventured into the dynamic realm of web development, and it's been an exhilarating ride.</p><p>My journey commenced during my post-graduation at CUSAT, where I laid the groundwork for my programming prowess and gained a firm grasp of database management systems. Since then, I've been on a continuous quest for knowledge and growth. I've specialized in Full Stack Development, delving into technologies such as Laravel, MySQL, Vue.js, and Node.js. Additionally, I've explored the intricate world of e-commerce, crafting bespoke solutions for Shopify platforms.</p><p>Beyond mastering popular technologies, I keep a finger on the pulse of modern development practices. I've embraced Docker for efficient containerization, harnessed GraphQL for streamlined API development, tapped into Elasticsearch for robust search capabilities, and leveraged NoSQL databases for scalable solutions.</p><p>Throughout my career, I've had the privilege of spearheading numerous web projects, consistently meeting or exceeding client expectations. What sets me apart is my knack for deciphering complex requirements and translating them into functional code. This ability has been instrumental in delivering user-friendly and high-performance applications.</p><p>My journey has equipped me with not only technical expertise but also strong problem-solving skills. My aim is to bring value to every project I'm a part of, and I'm passionate about collaborating effectively with cross-functional teams.</p><!-- <p>I invite you to explore my website further to discover more about my work, projects, and interests. If you're interested in working together or have any questions, please don't hesitate to get in touch. Let's connect and explore how I can contribute to your web development needs.</p>--><p>Thank you for visiting my About Me page, and I look forward to connecting with you!</p>"}],copyrightDate:new Date().getFullYear(),socialProfiles:[{id:"12345-fgff-4589-ghhhf",name:"GitHub",icon:"github",url:"https://github.com/Ebisontj"},{id:"12346-fgff-4589-ghhhf",name:"Linkedin",icon:"linkedin",url:"https://www.linkedin.com/in/ebison-t-joseph-b61282176"},{id:"12347-fgff-4589-ghhhf",name:"Twitter",icon:"twitter",url:"https://x.com/ebisontj"},{id:"12348-fgff-4589-ghhhf",name:"Facebook",icon:"facebook",url:"https://www.facebook.com/ebison.joseph.33"},{id:"12349-fgff-4589-ghhhf",name:"Instagram",icon:"instagram",url:"https://instagram.com/ebison_joseph"}],categories:[{id:"12345-fgff-4589-ghhhf",value:"web",name:"Web Application"},{id:"12345-fgff-4589-ghhhf",value:"mobile",name:"Mobile Applicaiton"},{id:"12345-fgff-4589-ghhhf",value:"ui-ux",name:"UI/UX Design"},{id:"12345-fgff-4589-ghhhf",value:"branding",name:"Branding & Animations"}]}),getters:{getProjectById:e=>i=>e.projects.find(t=>t.id==i)},actions:{}});export{a as u};
